import React, { useState } from "react"
import  Axios  from "axios"
import { TextField } from "@material-ui/core"

const Addass=()=>{
  const submit=()=>{
    Axios.post("http://localhost:3001/addassignment", {
            Subject_code: Subject_code,
            Question:Question,
            Deadline: Deadline,
            Class: Class,
            Assignment_id: Assignment_id,
        }).then((response) => {
            console.log(response)
            // window.location.reload();
        })
  }
  const [Assignment_id,setAssignment_id]=useState();
  const [Class,setClass]=useState();
  const [Deadline,setDeadline]=useState();
  const [Question,setQuestion]=useState();
  const [Subject_code,setSubjectcode]=useState();
    return(
        <div style={{padding:'100px',background:'#498EC5'}}>
        <TextField fullWidth onChange={(e) => {
            setAssignment_id(e.target.value);
        }}>Assignment_id</TextField><br/><br/>
        <TextField onChange={(e) => {
            setQuestion(e.target.value);
        }}>Question</TextField><br/><br/>
        <TextField onChange={(e) => {
            setDeadline(e.target.value);
        }}>Deadline</TextField><br/><br/>
        <TextField onChange={(e) => {
            setClass(e.target.value);
        }}>Class</TextField><br/><br/>
        <TextField onChange={(e) => {
            setSubjectcode(e.target.value);
        }}>Sub_code</TextField><br/><br/>
        <button onClick={submit}>Submit</button>
        </div>
    )
}

export default Addass;
